import styled from "styled-components";

export const FooterContainer = styled.footer`
    height: 167px;
    width: 100%;
    background: transparent;
    color: #8C8C8C;
    padding: 0px 32px;

`

export const NavigationItemsContainer = styled.div`
    margin-top: 25px;
    height: 100px;
    width: 100%;

    display: flex;
    justify-content: space-between;
    a{
        color: #8C8C8C;
    }
`
